// React
import React from "react";

// Third part
import { Table } from "antd";

const { Column } = Table;

const Tables = ({ data, colOne, colTwo, colThird, colFourth, colFive }) => {
  return (
    <Table dataSource={data}>
      <Column title={colOne} dataIndex="name" />
      <Column title={colTwo} />
      <Column title={colThird} />
      <Column title={colThird} />
      <Column title={colFourth} />
      <Column title={colFive}></Column>
    </Table>
  );
};

export default Tables;
